import React from 'react';
import './MainPage.css'; // Create a CSS file for styling
import stairs from './stairs.png'


function MainPage() {
  return (
    <div className="MainPage-page">
      <header className="MainPage-navbar">
        <a href="/data_table">Data Table</a>
        <a href="/MusicVisualiser"> Music Visualiser</a>
        <a href="/BasicExample"> BasicExample</a>



      </header>
      <div className="MainPage-content">
        <h1>Musical Stairs</h1>
                  <img src={stairs} alt="musical stairs" width="500" height="250" />

      </div>
      <div className="stairs">
        </div>
    </div>
  );
}


export default MainPage;
